import React from 'react';
import SigendOutMain from '../components/Main/SignedOutMain';
import SignedInMain from '../components/Main/SignedInMain';

class Main extends React.Component{
    render() {
        if(this.props.signedIn){
            return (
                <div className="signedInMain">
                    <SignedInMain selection={this.props.selection}/>
                </div>   
            )
        }else {
            return (
                <div className="signedOutMain">
                    <SigendOutMain openForm={this.props.openForm} logIn={this.props.logIn}/>
                </div>
            )
        }
    }
}

export default Main;
